import React from "react";
import "./App.css";
import Home from "./components/Home/Home";
import Todos from "./components/Todos/Todos";
import HomeProvider from "./contexts/HomeProvider";
function App() {
  return (
    <div className="App">
      <HomeProvider>
        <Home />
        <div className={`${showBigSpinner && "blur"}`}></div>
        <Todos />
      </HomeProvider>
    </div>
  );
}

export default App;
